import {Card} from 'react-bootstrap'


const Product = (props) => {
    return (
        <Card className="my-3 p-3 rounded" >
            <a href={`/product/${props.product._id}`}>
                <h1>{props.product.name}</h1>
            </a>

        </Card>
    )
}

export default Product
